      .enter().append("path")
        .attr("class", "adm1")

 svg.append("g")

svg.append("g")
	.attr("id","points")
	.selectAll(".pin")
	  .data(depots)
	  .enter().append("circle", ".pin")
	  .attr("r", 5)

		return "translate(" + map_projection([

		  d.coordinates[1]
		]) + ")";

	.attr("id","points2")
	.selectAll(".dot")
	  .data(loading)
	  .enter().append("circle", ".dot")
	  .attr("r", 2)
	  .attr("transform", function(d) {
		return "translate(" + map_projection([
		  d.longitude,
		  d.latitude
		]) + ")";
	  });

    .append("use")

svg.append("image")
    .attr("id", "Raster")
    .attr("clip-path", "url(#clip)")
    .attr("xlink:href", "final.png")
    .attr("class", "raster")
    .attr("width", map_width)
    .attr("height", map_height);
